import {
  Routes,
  Route,
  useNavigationType,
  useLocation,
} from "react-router-dom";
import DarkModeWeb from "./pages/DarkModeWeb";
import HeroSection from "./Components/HeroSection";
import { useEffect } from "react";

function App() {
  return (
    <Routes>
      <Route path="/" element={<DarkModeWeb />} />
      <Route path="/" element={<HeroSection />} />
    </Routes>
  );
}
export default App;
